import React from 'react';
import slideshow from '../../slideshow-img-1.png';
import '../../App.css';

class Slideshow extends React.Component {
	render() {
		return (
			<div>
			<img src={slideshow} alt='img' className='slideshow-img' />
			</div>
		)
	}
}

export default Slideshow;
